defs.script:
 let selectedDme = 0;

 window.parent.addEventListener("update", eventHandler, true);

 function eventHandler(update) {
   Update(update.detail);
 }

 var path = window.parent.location.pathname.split('/');
 path.pop();
 path = path.join("/") + "/";
 fetchAsync(window.parent.location.pathname + '/config.json')
  .then(data => {
    config = data[window.frameElement.id];
    return true;
  })
  .catch(reason => console.log("Error in config.json:\n" + reason))

 function init(){
    selectedDme = 2
 }

function Update(inputObject){
  for(let attr = 0; attr < Object.keys(inputObject).length; attr++){
  let key = Object.keys(inputObject)[attr];
  let value = Object.values(inputObject)[attr];
  switch (key) {

    case 'DME_SWITCH':
      selectedDme = value * 1 
      switch(selectedDme) {
        case 1:
          d3.select('#posOff').transition().duration(250).style('fill','#656b71')
          d3.select('#posN1').transition().duration(250).style('fill','#00ff00')
          d3.select('#posN2').transition().duration(250).style('fill','#656b71')
          d3.select('#g4513-5').transition().duration(250).style('opacity','1')
          d3.select('#g4513').transition().duration(250).style('opacity','1')
          d3.select('#posHld').transition().duration(250).style('fill','#656b71')
          d3.select('#gMinutes').transition().duration(250).style('opacity','1')
          d3.select('#knob').attr('transform', 'rotate(-31,-135.76351,148.50663)');
          break
        case 3:
          d3.select('#posOff').transition().duration(250).style('fill','#656b71')
          d3.select('#posN1').transition().duration(250).style('fill','#656b71')
          d3.select('#posN2').transition().duration(250).style('fill','#eeff00')
          d3.select('#g4513-5').transition().duration(250).style('opacity','1')
          d3.select('#g4513').transition().duration(250).style('opacity','1')
          d3.select('#gMinutes').transition().duration(250).style('opacity','1')
          d3.select('#posHld').transition().duration(250).style('fill','#656b71')
          d3.select('#knob').attr('transform', 'rotate(-95,-135.76351,148.50663)');
          break
        default:
          d3.select('#posOff').transition().duration(250).style('fill','#ff0000')
          d3.select('#posN1').transition().duration(250).style('fill','#656b71')
          d3.select('#posN2').transition().duration(250).style('fill','#656b71')
          d3.select('#posHld').transition().duration(250).style('fill','#656b71')
          d3.select('#g4513-5').transition().duration(250).style('opacity','0')
          d3.select('#g4513').transition().duration(250).style('opacity','0')
          d3.select('#gMinutes').transition().duration(250).style('opacity','0')
          d3.select('#knob').attr('transform', 'rotate(-65,-135.76351,148.50663)');
          break
      }
      break

    case 'NAV_1_DME_DISTANCE':
      if (selectedDme === 1) d3.select('#distance').text((value*1).toFixed(1))
      break
    case 'NAV_1_DME_SPEED':
      if (selectedDme === 1) d3.select('#speed').text((value*1).toFixed(0))
      break
    case 'NAV_1_DME_TIMETO':
      //if (selectedDme === 1) d3.select('#timeTo').text((value*1).toFixed(0))
      if (selectedDme === 1) d3.select('#timeTo').text((value/60).toFixed(0))
      break

    case 'NAV_2_DME_DISTANCE':
      if (selectedDme === 2) d3.select('#distance').text((value*1).toFixed(1))
      break
    case 'NAV_2_DME_SPEED':
      if (selectedDme === 2) d3.select('#speed').text((value*1).toFixed(0))
      break
    case 'NAV_2_DME_TIMETO':
      //if (selectedDme === 2) d3.select('#timeTo').text((value*1).toFixed(0))
      if (selectedDme === 2) d3.select('#timeTo').text((value/60).toFixed(0))
      break

    default:
      //console.log('       :-(    Attribute '+key+' not relevant for this element... Ignoring');
    }
  }
}
